import React from 'react';
import $ from "jquery";
import  { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function Booking() {
  const [guests, setGuests] = useState(0);
  const [name, setName] = useState("");
  const [date, setDate] = useState("")
  const handleAddGuest = () => {
    if (guests < 10) {

      setGuests(guests + 1);

       }
  };

  const handleRemoveGuest = () => {
    if (guests > 0) {
      setGuests(guests - 1);

    }
  };

  const handleName = (e) => {
      setName(e.target.value);
  };

  const handleDate = (e) => {
      setDate(e.target.value);
  };

  const [guestList, setGuestList] = useState([]);

  const handleSumbit = (e) => {
    e.preventDefault();
    const form = $(e.target);
    $.ajax({
      type: "POST",
      url: form.attr("action"),
      data: form.serialize(),
      success(data) {
        setGuestList((guestList) => [...guestList, data]);
      },
    });
  };

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6 mx-auto">
          <h2>Book a table</h2>
          <form method="POST" action="http://localhost:9000/guestList.php" onSubmit={(event) => handleSumbit(event)}>
            <div className="form-group">
              <label htmlFor="name">Name:</label>
              <input type="text" className="form-control" id="name" name="name" value={name} onChange={(event) => handleName(event)} />
            </div>
            <div className="form-group">
              <label htmlFor="guests">Number of Guests:</label>
              <div className="input-group">
                <button type="button" className="btn btn-secondary" id="add-guest" onClick={handleAddGuest}>+</button>
                <input type="text" className="form-control" id="guests" name="guests" value={guests} readOnly />
                <button type="button" className="btn btn-secondary" id="remove-guest" onClick={handleRemoveGuest}>-</button>
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="date">Date:</label>
              <input type="date" className="form-control" id="date" name="date" value={date} onChange={handleDate} />
            </div>
            <button type="submit" className="btn btn-primary">Book now</button>
          </form>
        </div>
      </div>
      <div className="row mt-4">
        <div className="col-md-6 mx-auto">
          <h2>Guest List</h2>
          <table className="table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Number of Guests</th>
                <th>Date</th>
              </tr>
            </thead>
            <tbody>
              {guestList.map((guest, index) => (
                <tr key={index}>
                  <td>{guest.name}</td>
                  <td>{guest.guests}</td>
                  <td>{guest.date}</td>
                </tr>
              ))}
            </tbody>
          </table>
          </div>
          </div>
          </div>

  )
}


export default Booking;
